import { Col } from "antd";
import AppLayout from "../components/AppLayout";
import More from "../components/more";

const profileMore = () => {
    return(
        <AppLayout>
            <Col>
                <More header="팔로잉"/>
                <More header="팔로워"/>
                <More header="좋아요한 룩" />
            </Col>
          
        </AppLayout>
    );
};

export default profileMore;
